import { ADD_TO_CART, INCREMENT_CART_ITEM } from "./actions"

export const addToCartAC = (payload) => ({ type: ADD_TO_CART, payload })
export const incrementCartItem = (payload) => ({ type: INCREMENT_CART_ITEM, payload })
